        DECLARE v_remaining_needed DECIMAL(10,2);
        

        DECLARE v_stock_id BIGINT;
        DECLARE v_current_stock DECIMAL(10,2);
        DECLARE v_deduct_amount DECIMAL(10,2);
        
       
        DECLARE ingredient_cur CURSOR FOR
             SELECT 
                ingredient_id, 
                SUM(total_ingredient_used) as total_needed
            FROM ingredient_used 
            GROUP BY ingredient_id
            ORDER BY ingredient_id;
        

        DECLARE stock_cur CURSOR FOR
            SELECT 
                ingredient_stock_id,
                current_stock
            FROM ingredient_stock iss
            WHERE iss.ingredient_id = v_ingredient_id 
                AND iss.current_stock > 0
                AND iss.expiry_date > NOW()
            ORDER BY iss.created_at ASC, iss.ingredient_stock_id ASC;
        
        DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
   
        DROP TEMPORARY TABLE IF EXISTS ingredient_used;
        CREATE TEMPORARY TABLE ingredient_used AS 
        SELECT 
            menu_detail_id,
            ingredient_id, 
            total_ingredient_used
        FROM v_retrieve_reserved_ingredients
        WHERE order_id = p_order_id;


        OPEN ingredient_cur;
        
        ingredient_loop: LOOP
            FETCH ingredient_cur INTO v_ingredient_id, v_total_needed;
            IF done THEN 
                LEAVE ingredient_loop;
            END IF;
            
            SET v_remaining_needed = v_total_needed;
            SET stock_done = FALSE;
   
            OPEN stock_cur;
            
            stock_loop: LOOP
                BEGIN
                    DECLARE CONTINUE HANDLER FOR NOT FOUND SET stock_done = TRUE;
                    
                    FETCH stock_cur INTO v_stock_id, v_current_stock;
                    IF stock_done THEN 
                        LEAVE stock_loop;
                    END IF;
                END;
                
              
                SET v_deduct_amount = LEAST(v_remaining_needed, v_current_stock);
                
                IF v_deduct_amount > 0 THEN
          
                    UPDATE ingredient_stock
                    SET current_stock = current_stock - v_deduct_amount
                    WHERE ingredient_stock_id = v_stock_id;
        
                    SET v_remaining_needed = v_remaining_needed - v_deduct_amount;
                    
                  
                    IF v_remaining_needed <= 0 THEN
                        LEAVE stock_loop;
                    END IF;
                END IF;
                
            END LOOP stock_loop;
            
            CLOSE stock_cur;
            
        
          /*  IF v_remaining_needed > 0 THEN
               SET MESSAGE_TEXT = 'nega ingrdient';
            END IF;*/
            
        END LOOP ingredient_loop;
        
        CLOSE ingredient_cur;
        DROP TEMPORARY TABLE IF EXISTS ingredient_used;
        
    END;
    
    COMMIT;
    
END ;;
DELIMITER ;
