CREATE DEFINER=`root`@`localhost` PROCEDURE `p_menu_max_order`(
	IN p_menu_detail_id BIGINT,
    IN p_json JSON
)
BEGIN
	DECLARE done INT DEFAULT FALSE;
	DECLARE v_menu_detail_id BIGINT;
	DECLARE v_purchase_qty BIGINT;
    DECLARE v_full_value JSON;
    
    
    DECLARE cur CURSOR FOR
        SELECT 
           CAST(
			  JSON_UNQUOTE(
				  JSON_EXTRACT(j.value, '$.Menudetail_id')
                  ) AS UNSIGNED
			  ) AS Menu_ID,
            CAST(JSON_UNQUOTE(JSON_EXTRACT(j.value, '$.PurchaseQty')) AS UNSIGNED),
            j.value AS full_value
        FROM JSON_TABLE(p_json, '$[*]' COLUMNS (
            value JSON PATH '$'
        )) AS j;
        
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
    
	DROP TABLE IF EXISTS temp_reserved_ingredients;
    CREATE TEMPORARY TABLE temp_reserved_ingredients (
		menu_detail_id BIGINT,
        ingredient_id BIGINT,
        reserved_quantity INT
    );
    
    OPEN cur;
    read_loop: LOOP
        FETCH cur INTO v_menu_detail_id, v_purchase_qty, v_full_value;
        IF done THEN
            LEAVE read_loop;
        END IF;

		IF JSON_EXTRACT(v_full_value, '$.MenuDetailList') IS NOT NULL THEN
            INSERT INTO temp_reserved_ingredients
            SELECT 
                pg.menu_detail_id,
                x.ingredient_id, 
                x.quantity * v_purchase_qty
            FROM JSON_TABLE(
                JSON_EXTRACT(v_full_value, '$.MenuDetailList'), 
                '$[*]' COLUMNS (
                    menu_detail_id BIGINT PATH '$.Menudetail_id'
                )
            ) AS pg
            JOIN v_retrieve_menu_ingredients x ON x.menu_detail_id = pg.menu_detail_id;
		ELSE 
			INSERT INTO temp_reserved_ingredients
			SELECT x.menu_detail_id, x.ingredient_id, x.quantity * v_purchase_qty FROM v_retrieve_menu_ingredients x
			WHERE x.menu_detail_id = v_menu_detail_id;
        END IF;
	END LOOP;
    CLOSE cur;
    
	DROP TABLE IF EXISTS reserved_totals;
    CREATE TEMPORARY TABLE reserved_totals AS
    SELECT 
        ingredient_id, 
        SUM(total_reserved) as total_reserved
    FROM (
        SELECT ingredient_id, SUM(total_ingredient_used) as total_reserved 
        FROM v_retrieve_reserved_ingredients
        GROUP BY ingredient_id
        UNION ALL
        SELECT ingredient_id, SUM(reserved_quantity) as total_reserved
        FROM temp_reserved_ingredients
        GROUP BY ingredient_id
    ) c
    GROUP BY ingredient_id;
    
	DROP TEMPORARY TABLE IF EXISTS target_ingredient;
    CREATE TEMPORARY TABLE target_ingredient AS
	SELECT x.menu_detail_id, x.ingredient_id, x.quantity FROM v_retrieve_menu_ingredients x
	WHERE x.menu_detail_id = p_menu_detail_id;
    /*UNION ALL
    SELECT mp.included_menu_detail_id as menu_detail_id, x.ingredient_id, x.quantity 
    FROM menu_package mp
    JOIN v_retrieve_menu_ingredients x ON x.menu_detail_id = mp.included_menu_detail_id
    WHERE mp.from_menu_detail_id = p_menu_detail_id;*/


	SELECT 
        CASE WHEN COUNT(*) = 0 THEN 0
		ELSE 
			GREATEST(MIN(FLOOR(
            	(COALESCE(stock.current_stock, 0) - COALESCE(rt.total_reserved, 0)) / NULLIF(ti.quantity, 0)
			)), 0)
        END AS max_order
	FROM target_ingredient ti
	LEFT JOIN (
        SELECT iss.ingredient_id,i.unit, SUM(iss.current_stock) AS current_stock
        FROM ingredient_stock iss
        INNER JOIN ingredients i ON i.ingredient_id = iss.ingredient_id
        WHERE expiry_date > NOW()
        GROUP BY ingredient_id
    ) stock ON ti.ingredient_id = stock.ingredient_id
    LEFT JOIN reserved_totals rt ON rt.ingredient_id = ti.ingredient_id;

	DROP TABLE IF EXISTS temp_reserved_ingredients;
	DROP TABLE IF EXISTS reserved_totals;
    DROP TEMPORARY TABLE IF EXISTS target_ingredient;
END ;;
DELIMITER ;
