DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `p_menu_package_price`(
    IN p_package_id BIGINT,
    IN p_included JSON
)
BEGIN
    DECLARE v_orig_package_price DECIMAL(10,2);
    DECLARE v_total_item_cost DECIMAL(10,2) DEFAULT 0.00;
    DECLARE v_original_items_cost DECIMAL(10,2) DEFAULT 0.00;
    DECLARE v_final_price DECIMAL(10,2);
    
    DROP TEMPORARY TABLE IF EXISTS temp_original_items;
    DROP TEMPORARY TABLE IF EXISTS temp_selected_items;
    
    CREATE TEMPORARY TABLE temp_original_items (
        menu_detail_id BIGINT,
        quantity INT,
        unit_price DECIMAL(10,2),
        total_price DECIMAL(10,2)
    );
    
    CREATE TEMPORARY TABLE temp_selected_items (
        menu_detail_id BIGINT,
        quantity INT,
        unit_price DECIMAL(10,2),
        total_price DECIMAL(10,2)
    );
    
    INSERT INTO temp_original_items (menu_detail_id, quantity, unit_price, total_price)
    SELECT 
        md.menu_detail_id,
        mp.quantity,
        md.price,
        md.price * mp.quantity
    FROM menu_detail md
    JOIN menu_package mp ON md.menu_detail_id = mp.included_menu_detail_id
    WHERE mp.from_menu_detail_id = p_package_id;

    SELECT COALESCE(SUM(total_price), 0) INTO v_original_items_cost FROM temp_original_items;
    

    INSERT INTO temp_selected_items (menu_detail_id, quantity, unit_price, total_price)
    SELECT 
        menu_detail_id,
        COUNT(*) as quantity,
        MAX(price) as unit_price,
        COUNT(*) * MAX(price) as total_price
    FROM (
        SELECT 
            CAST(JSON_UNQUOTE(JSON_EXTRACT(j.value, '$.Menudetail_id')) AS SIGNED) as menu_detail_id,
            CAST(JSON_UNQUOTE(JSON_EXTRACT(j.value, '$.Price')) AS DECIMAL(10,2)) as price
        FROM JSON_TABLE(p_included, '$[*]' COLUMNS (
            value JSON PATH '$'
        )) AS j
    ) parsed_json
    GROUP BY menu_detail_id;
    

    SELECT md.price - (md.price * COALESCE(d.rate, 0)) INTO v_orig_package_price
    FROM menu_detail md
    LEFT JOIN menu_discount mdc ON mdc.menu_id = md.menu_id
    LEFT JOIN discount d ON d.discount_id = mdc.discount_id
    WHERE md.menu_detail_id = p_package_id;
    

    SELECT COALESCE(SUM(total_price), 0) INTO v_total_item_cost FROM temp_selected_items;
    
    SET v_final_price = v_orig_package_price + (v_total_item_cost - v_original_items_cost);
    
    SELECT v_final_price as final_price;
    
    DROP TEMPORARY TABLE IF EXISTS temp_original_items;
    DROP TEMPORARY TABLE IF EXISTS temp_selected_items;
END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
