CREATE DEFINER=`root`@`localhost` PROCEDURE `p_menu_package_price_by_order`(
    IN p_order_id VARCHAR(255),
    OUT p_price DECIMAL(10,2)
)
BEGIN
    DECLARE done BOOLEAN DEFAULT FALSE;
    DECLARE v_order_item_id BIGINT;
    DECLARE v_package_id BIGINT;
    DECLARE v_orig_package_price DECIMAL(10,2);
    DECLARE v_total_upgrade_price DECIMAL(10,2) DEFAULT 0.00;
    DECLARE v_final_price DECIMAL(10,2);
    DECLARE v_matched BOOLEAN DEFAULT TRUE;
    DECLARE v_orig_menu_price DECIMAL(10,2) DEFAULT 0.00;
    DECLARE v_ordered_menu_price DECIMAL(10,2) DEFAULT 0.00;
    
    DECLARE cur CURSOR FOR 
        SELECT DISTINCT oi.order_item_id, mop.from_menu_detail_id
        FROM order_item oi
        INNER JOIN menu_order_package mop ON mop.order_item_id = oi.order_item_id
        WHERE oi.order_id = p_order_id;

    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
    
    DROP TEMPORARY TABLE IF EXISTS temp_default_package;
    DROP TEMPORARY TABLE IF EXISTS temp_ordered_package;
    DROP TEMPORARY TABLE IF EXISTS temp_results;
    
    CREATE TEMPORARY TABLE temp_default_package (
        menu_detail_id BIGINT,
        price DECIMAL(10,2),
        quantity INT,
        total DECIMAL(10,2)
    );
    
    CREATE TEMPORARY TABLE temp_ordered_package (
        menu_detail_id BIGINT,
        price DECIMAL(10,2),
        quantity INT,
        total DECIMAL(10,2)
    );
    
    CREATE TEMPORARY TABLE temp_results (
        order_item_id BIGINT,
        package_menu_detail_id BIGINT,
        matched BOOLEAN,
        orig_price DECIMAL(10,2),
        upgrade_price DECIMAL(10,2),
        final_price DECIMAL(10,2)
    );
    
    OPEN cur;
    
    read_loop: LOOP
        FETCH cur INTO v_order_item_id, v_package_id;
        
        IF done THEN
            LEAVE read_loop;
        END IF;
        
        TRUNCATE TABLE temp_default_package;
        TRUNCATE TABLE temp_ordered_package;
        
        INSERT INTO temp_default_package (menu_detail_id, price, quantity, total)
        SELECT 
            mp.included_menu_detail_id,
            md.price,
            mp.quantity,
            md.price * mp.quantity
        FROM menu_package mp
        JOIN menu_detail md ON md.menu_detail_id = mp.included_menu_detail_id
        WHERE mp.from_menu_detail_id = v_package_id;
        
        INSERT INTO temp_ordered_package (menu_detail_id, price, total)
        SELECT 
            mop.included_detail_id,
            md.price,
            SUM(md.price) as total_cost
        FROM menu_order_package mop
        JOIN menu_detail md ON md.menu_detail_id = mop.included_detail_id
        WHERE mop.order_item_id = v_order_item_id
        GROUP BY mop.included_detail_id, md.price;
        
        SELECT COALESCE(md.price - (md.price * COALESCE(d.rate, 0)), md.price)
        INTO v_orig_package_price
        FROM menu_detail md
        LEFT JOIN menu_discount mdc ON mdc.menu_id = md.menu_id
        LEFT JOIN discount d ON d.discount_id = mdc.discount_id AND d.until_date > NOW()
        WHERE md.menu_detail_id = v_package_id;
        

        SELECT COALESCE(SUM(total), 0) INTO v_orig_menu_price FROM temp_default_package;
        SELECT COALESCE(SUM(total), 0) INTO v_ordered_menu_price FROM temp_ordered_package;
        

        SET v_matched = TRUE;
        

        IF EXISTS (
            SELECT 1 
            FROM temp_default_package dp
            LEFT JOIN temp_ordered_package op ON dp.menu_detail_id = op.menu_detail_id
            WHERE op.menu_detail_id IS NULL 
               OR dp.quantity != op.quantity
        ) THEN
            SET v_matched = FALSE;
        END IF;
        
        IF EXISTS (
            SELECT 1
            FROM temp_ordered_package op
            LEFT JOIN temp_default_package dp ON op.menu_detail_id = dp.menu_detail_id
            WHERE dp.menu_detail_id IS NULL
        ) THEN
            SET v_matched = FALSE;
        END IF;
        
        IF v_matched THEN
            SET v_total_upgrade_price = 0.00;
            SET v_final_price = v_orig_package_price;
        ELSE
            SET v_total_upgrade_price = v_ordered_menu_price - v_orig_menu_price;
            SET v_final_price = v_orig_package_price + v_total_upgrade_price;
        END IF;
        
        INSERT INTO temp_results (
            order_item_id, 
            package_menu_detail_id, 
            matched, 
            orig_price, 
            upgrade_price, 
            final_price
        )
        VALUES (
            v_order_item_id, 
            v_package_id, 
            v_matched, 
            v_orig_package_price, 
            v_total_upgrade_price, 
            v_final_price
        );
        
    END LOOP;
    
    CLOSE cur;
    /*
    SELECT 
        o.order_id,
        m.menu_name,
        f.flavor_name,
        s.size_name,
        oi.order_item_id,
        oi.quantity,
        'regular' as item_type,
        ROUND(md.price - (md.price * COALESCE(d.rate, 0)), 2) AS final_price
    FROM orders o
    INNER JOIN order_item oi ON o.order_id = oi.order_id
    INNER JOIN menu_order_regular mor ON mor.order_item_id = oi.order_item_id
    INNER JOIN menu_detail md ON md.menu_detail_id = mor.menu_detail_id
    INNER JOIN flavor f ON f.flavor_id = md.flavor_id
    INNER JOIN size s ON s.size_id = md.size_id
    INNER JOIN menu m ON m.menu_id = md.menu_id
    LEFT JOIN order_item_discount oid ON oid.order_item_id = oi.order_item_id
    LEFT JOIN discount d ON d.discount_id = oid.discount_id
    WHERE o.order_id = p_order_id
    
    UNION ALL
    
    SELECT 
        o.order_id,
        m.menu_name,
        f.flavor_name,
        s.size_name,
        oi.order_item_id,
        oi.quantity,
        'package' as item_type,
        ROUND(tr.final_price, 2) as final_price
    FROM orders o
    INNER JOIN order_item oi ON o.order_id = oi.order_id
    INNER JOIN menu_order_package mop ON mop.order_item_id = oi.order_item_id
    INNER JOIN temp_results tr ON tr.order_item_id = oi.order_item_id
    INNER JOIN menu_detail md ON md.menu_detail_id = tr.package_menu_detail_id
    INNER JOIN menu m ON m.menu_id = md.menu_id
    INNER JOIN flavor f ON f.flavor_id = md.flavor_id
    INNER JOIN size s ON s.size_id = md.size_id
    WHERE o.order_id = p_order_id
    ORDER BY order_item_id, item_type;
    */
	SET p_price = v_final_price;
    DROP TEMPORARY TABLE IF EXISTS temp_default_package;
    DROP TEMPORARY TABLE IF EXISTS temp_ordered_package;
    DROP TEMPORARY TABLE IF EXISTS temp_results;
    
END ;;
DELIMITER ;
