CREATE DEFINER=`root`@`localhost` PROCEDURE `p_NewOrder`(
	IN p_json_orderList JSON,
    IN p_coupon_code VARCHAR(255)
)
BEGIN
	DECLARE done INT DEFAULT FALSE;
    DECLARE v_menu_detail_id BIGINT;
    DECLARE v_purchaseQty BIGINT;
    DECLARE v_json_orderList JSON;
    DECLARE v_order_id VARCHAR(255);
    DECLARE v_order_item_id BIGINT;
	DECLARE v_max_time TIME;
	DECLARE v_total DECIMAL(10,2);
	DECLARE v_rate_coupon DECIMAL(10,2);
    DECLARE v_tax_rate DECIMAL(5,2);
    
    
    DECLARE cur CURSOR FOR
        SELECT 
			JSON_UNQUOTE(JSON_EXTRACT(j.value, '$.Menudetail_id')),
			JSON_UNQUOTE(JSON_EXTRACT(j.value, '$.PurchaseQty')),
            j.value AS full_value
        FROM JSON_TABLE(p_json_orderList, '$[*]' COLUMNS (
            value JSON PATH '$'
        )) AS j;  
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
    START TRANSACTION;
    
    CALL p_generateNextOrderID(v_order_id);
	SET v_tax_rate = 0.12;
   
	SELECT MAX(EstimatedTime) INTO v_max_time
	FROM (
	SELECT JSON_UNQUOTE(JSON_EXTRACT(j.value, '$.EstimatedTime')) AS EstimatedTime
	FROM JSON_TABLE(p_json_orderList, '$[*]' COLUMNS (
		value JSON PATH '$'
	)) AS j
	UNION ALL
	SELECT JSON_UNQUOTE(JSON_EXTRACT(j.value, '$.EstimatedTime')) AS EstimatedTime
	FROM JSON_TABLE(p_json_orderList, '$[*].MenuDetailList[*]' COLUMNS (
		value JSON PATH '$'
	)) AS j
	) AS max_time;
    
    IF p_coupon_code IS NOT NULL OR p_coupon_code <> '' THEN
		SELECT rate INTO v_rate_coupon FROM coupon WHERE coupon_code = p_coupon_code;
		INSERT INTO order_coupon VALUES (v_order_id,p_coupon_code);
        UPDATE coupon SET status = 'Used' WHERE coupon_code = p_coupon_code;
    END IF;
	
	
	SELECT 
		SUM(JSON_UNQUOTE(JSON_EXTRACT(j.value, '$.Price')) * JSON_UNQUOTE(JSON_EXTRACT(j.value, '$.PurchaseQty'))) INTO v_total
	FROM JSON_TABLE(p_json_orderList, '$[*]' COLUMNS (
		value JSON PATH '$'
	)) AS j;
	
    SET v_total = v_total - (COALESCE(v_rate_coupon,0) * v_total);
    
    SET v_total = v_total + (v_total * v_tax_rate);
    INSERT INTO orders (order_id,estimated_max_time,available_until,total_amount,status) VALUES
    (v_order_id, v_max_time, DATE_ADD(NOW(), INTERVAL 30 MINUTE), v_total  , 'Pending');
    

	OPEN cur;
    
    read_loop : LOOP
		FETCH cur INTO v_menu_detail_id,v_purchaseQty, v_json_orderList;
		IF done THEN 
			LEAVE read_loop;
        END IF;
		INSERT INTO order_item (quantity,order_id) VALUES (v_purchaseQty,v_order_id);
        SET v_order_item_id = LAST_INSERT_ID();
        
        IF JSON_CONTAINS_PATH(v_json_orderList,'one','$.MenuDetailList') THEN
			   INSERT INTO menu_order_package  
				SELECT 
					v_menu_detail_id,
					JSON_UNQUOTE(JSON_EXTRACT(j.value, '$.Menudetail_id')),
					v_order_item_id
				FROM JSON_TABLE(
					v_json_orderList, '$.MenuDetailList[*]' COLUMNS (
						value JSON PATH '$'
					)
				) AS j;
		ELSE 
			INSERT INTO menu_order_regular VALUES
			(v_menu_detail_id,v_order_item_id);
		END IF;
        
			
		IF JSON_EXTRACT(v_json_orderList, '$.DiscountId') IS NOT NULL AND JSON_EXTRACT(v_json_orderList, '$.DiscountId') > 0 THEN
			INSERT INTO order_item_discount (order_item_id, discount_id)
			VALUES (
				v_order_item_id,
				JSON_UNQUOTE(JSON_EXTRACT(v_json_orderList, '$.DiscountId'))
			);
		END IF;
    END LOOP;
    
    CLOSE cur;
    
    COMMIT;
END ;;
