CREATE DEFINER=`root`@`localhost` PROCEDURE `p_payment`(
	IN p_order_id VARCHAR(255),
    IN p_staff_id BIGINT,
    IN p_payment_method ENUM('Cash','Credit-Card')
)
BEGIN
	DECLARE p_payment_id BIGINT;
    DECLARE p_authorized_user VARCHAR(255);
	DECLARE new_waiting_number INT;
	DECLARE EXIT HANDLER FOR SQLEXCEPTION
    BEGIN
        ROLLBACK;
        RESIGNAL;
        SIGNAL SQLSTATE '45000'
            SET MESSAGE_TEXT = 'Internal Server Error';
    END;
    START TRANSACTION;
    SET p_payment_id = (SELECT payment_id FROM payment WHERE payment_method = p_payment_method);
	
    SELECT IFNULL(MAX(waiting_number), 0) + 1
    INTO new_waiting_number
    FROM invoice
    WHERE DATE(created_at) = CURDATE();

    -- SET p_authorized_user = (SELECT role FROM staff WHERE staff_id = p_staff_id);
    
    INSERT INTO invoice (waiting_number,order_id,staff_id,payment_id) VALUES (new_waiting_number,p_order_id,p_staff_id,p_payment_id);
    
    COMMIT;
END ;;
