CREATE DEFINER=`root`@`localhost` PROCEDURE `p_retrieve_FrequentlyOrderedTogether`(
IN p_menu_id BIGINT
)
BEGIN
	IF (
        SELECT COUNT(*)
        FROM order_item oi
        LEFT JOIN menu_order_regular mor ON mor.order_item_id = oi.order_item_id
		LEFT JOIN menu_order_package mop ON mop.order_item_id = oi.order_item_id
        INNER JOIN menu_detail md ON md.menu_detail_id = mor.menu_detail_id 
        INNER JOIN menu_detail md1 ON md1.menu_detail_id = mop.from_menu_detail_id
        INNER JOIN menu m ON m.menu_id = md.menu_id
        WHERE m.menu_id = p_menu_id 
    ) > 0 THEN 

	
	SELECT rm.*
    FROM order_item oi
    INNER JOIN v_retrieve_menu_v2 rm ON rm.menu_detail_id = oi.menu_detail_id
    WHERE oi.order_id IN (
        SELECT DISTINCT oi2.order_id
        FROM order_item oi2
        LEFT JOIN menu_order_regular mor ON mor.order_item_id = oi2.order_item_id
        LEFT JOIN menu_order_package mop ON mop.order_item_id = oi2.order_item_id
        WHERE EXISTS (
            SELECT 1
            FROM menu_detail md_r
            WHERE md_r.menu_detail_id = mor.menu_detail_id
              AND md_r.menu_id = p_menu_id
        )
        OR EXISTS (
            SELECT 1
            FROM menu_detail md_p
            WHERE md_p.menu_detail_id = mop.from_menu_detail_id
              AND md_p.menu_id = p_menu_id
        )
    )
    AND rm.menu_id <> p_menu_id
    GROUP BY rm.menu_detail_id
    LIMIT 5;
    ELSE

		SELECT *
		FROM v_retrieve_menu_v2
        WHERE menu_id <> p_menu_id AND flavor_name = 'Regular' AND size_name = 'Regular'
		ORDER BY RAND()
		LIMIT 5;

    END IF;
END ;;
DELIMITER ;
