CREATE DEFINER=`root`@`localhost` PROCEDURE `p_retrieve_order`(
    IN p_order_id VARCHAR(255)
)
BEGIN
    DECLARE done BOOLEAN DEFAULT FALSE;
    DECLARE v_order_item_id BIGINT;
    DECLARE v_package_id BIGINT;
    DECLARE v_orig_package_price DECIMAL(10,2);
    DECLARE v_total_upgrade DECIMAL(10,2) DEFAULT 0.00;
    DECLARE v_final_price DECIMAL(10,2);
    DECLARE v_items_match BOOLEAN DEFAULT TRUE;
    DECLARE v_regular_count INT DEFAULT 0;
    DECLARE v_ordered_count INT DEFAULT 0;
    DECLARE v_substitution_cost DECIMAL(10,2) DEFAULT 0.00;
    DECLARE v_addition_cost DECIMAL(10,2) DEFAULT 0.00;
    DECLARE v_removal_cost DECIMAL(10,2) DEFAULT 0.00;
    
    DECLARE cur CURSOR FOR 
        SELECT DISTINCT oi.order_item_id, mop.from_menu_detail_id
        FROM order_item oi
        INNER JOIN menu_order_package mop ON mop.order_item_id = oi.order_item_id
        WHERE oi.order_id = p_order_id;

    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
    

    SET @row := 0;
    

    DROP TEMPORARY TABLE IF EXISTS temp_default_package;
    DROP TEMPORARY TABLE IF EXISTS temp_ordered_package;
    DROP TEMPORARY TABLE IF EXISTS temp_results;
    

    CREATE TEMPORARY TABLE temp_default_package (
        row_index INT,
        menu_detail_id BIGINT,
        price DECIMAL(10,2)
    );
    
    CREATE TEMPORARY TABLE temp_ordered_package (
        row_index INT,
        menu_detail_id BIGINT,
        price DECIMAL(10,2)
    );
    
    CREATE TEMPORARY TABLE temp_results (
        order_item_id BIGINT,
        package_menu_detail_id BIGINT,
        item_match BOOLEAN,
        original_price DECIMAL(10,2),
        upgrade_cost DECIMAL(10,2),
        final_price DECIMAL(10,2)
    );
    

    OPEN cur;
    

    read_loop: LOOP
        FETCH cur INTO v_order_item_id, v_package_id;
        
        IF done THEN
            LEAVE read_loop;
        END IF;
        

        TRUNCATE TABLE temp_default_package;
        TRUNCATE TABLE temp_ordered_package;
        

        SET @row := 0;
        

        INSERT INTO temp_default_package (row_index, menu_detail_id, price)
        SELECT 
            @row := @row + 1 AS row_index,
            mp.included_menu_detail_id,
            md.price
        FROM menu_package mp
        JOIN menu_detail md ON md.menu_detail_id = mp.included_menu_detail_id
        WHERE mp.from_menu_detail_id = v_package_id
        ORDER BY mp.included_menu_detail_id;

        SET @row := 0;
        
        INSERT INTO temp_ordered_package (row_index, menu_detail_id, price)
        SELECT 
            @row := @row + 1 AS row_index,
            mop.included_detail_id,
            md.price
		FROM menu_order_package mop
        JOIN menu_detail md ON md.menu_detail_id = mop.included_detail_id
        WHERE mop.order_item_id = v_order_item_id
        ORDER BY mop.included_detail_id;
        

        SET v_items_match = TRUE;
        

        IF (SELECT COUNT(*) FROM temp_default_package) != (SELECT COUNT(*) FROM temp_ordered_package) THEN
            SET v_items_match = FALSE;
        ELSE
            
            
            IF EXISTS (
                SELECT 1 
                FROM temp_default_package dp 
                LEFT JOIN temp_ordered_package op ON dp.row_index = op.row_index 
                WHERE dp.menu_detail_id != op.menu_detail_id 
                   OR op.menu_detail_id IS NULL
            ) THEN
                SET v_items_match = FALSE;
            END IF;
        END IF;
        
        SELECT COALESCE(md.price - (md.price * COALESCE(d.rate, 0)), md.price)
        INTO v_orig_package_price
        FROM menu_detail md
        LEFT JOIN menu_discount mdc ON mdc.menu_id = md.menu_id
        LEFT JOIN discount d ON d.discount_id = mdc.discount_id AND d.until_date > NOW()
        WHERE md.menu_detail_id = v_package_id;
        

        IF v_items_match THEN
            SET v_total_upgrade = 0.00;
            SET v_final_price = v_orig_package_price;
        ELSE
            SET v_substitution_cost = 0.00;
            SET v_addition_cost = 0.00;
            SET v_removal_cost = 0.00;
            
            SELECT COUNT(*) INTO v_regular_count FROM temp_default_package;
            SELECT COUNT(*) INTO v_ordered_count FROM temp_ordered_package;
            
            SELECT COALESCE(SUM(
                CASE 
                    WHEN dp.menu_detail_id = op.menu_detail_id THEN
                        op.price - dp.price 
                    WHEN dp.menu_detail_id != op.menu_detail_id THEN
                        op.price - dp.price 
                    ELSE 0
                END
            ), 0)
            INTO v_substitution_cost
            FROM temp_default_package dp
            INNER JOIN temp_ordered_package op ON dp.row_index = op.row_index;
            
            IF v_ordered_count > v_regular_count THEN
                SELECT COALESCE(SUM(op.price ), 0)
                INTO v_addition_cost
                FROM temp_ordered_package op
                WHERE op.row_index > v_regular_count;
            END IF;
            
  
            IF v_regular_count > v_ordered_count THEN
                SELECT COALESCE(SUM(-(dp.price )), 0)
                INTO v_removal_cost
                FROM temp_default_package dp
                WHERE dp.row_index > v_ordered_count;
            END IF;
            
            SET v_total_upgrade = v_substitution_cost + v_addition_cost + v_removal_cost;
            SET v_final_price = v_orig_package_price + v_total_upgrade;
        END IF;
        

        INSERT INTO temp_results (
            order_item_id, 
            package_menu_detail_id, 
            item_match, 
            original_price, 
            upgrade_cost, 
            final_price
        )
        VALUES (
            v_order_item_id, 
            v_package_id, 
            v_items_match, 
            v_orig_package_price, 
            v_total_upgrade, 
            v_final_price
        );
        
    END LOOP;
    

    CLOSE cur;
    

    SELECT 
        o.order_id,
        m.menu_name,
        f.flavor_name,
        s.size_name,
        oi.order_item_id,
        oi.quantity,
        'regular' as item_type,
        ROUND(md.price - (md.price * COALESCE(d.rate, 0)), 2) AS final_price
    FROM orders o
    INNER JOIN order_item oi ON o.order_id = oi.order_id
    INNER JOIN menu_order_regular mor ON mor.order_item_id = oi.order_item_id
    INNER JOIN menu_detail md ON md.menu_detail_id = mor.menu_detail_id
    INNER JOIN flavor f ON f.flavor_id = md.flavor_id
    INNER JOIN size s ON s.size_id = md.size_id
    INNER JOIN menu m ON m.menu_id = md.menu_id
    LEFT JOIN order_item_discount oid ON oid.order_item_id = oi.order_item_id
    LEFT JOIN discount d ON d.discount_id = oid.discount_id
    WHERE o.order_id = p_order_id
    
    UNION ALL
    
    SELECT 
        o.order_id,
        m.menu_name,
        f.flavor_name,
        s.size_name,
        oi.order_item_id,
        oi.quantity,
        'package' as item_type,
        tr.final_price
       -- tr.upgrade_cost,
       -- tr.item_match
    FROM orders o
    INNER JOIN order_item oi ON o.order_id = oi.order_id
    INNER JOIN menu_order_package mop ON mop.order_item_id = oi.order_item_id
    INNER JOIN temp_results tr ON tr.order_item_id = oi.order_item_id
    INNER JOIN menu_detail md ON md.menu_detail_id = tr.package_menu_detail_id
    INNER JOIN menu m ON m.menu_id = md.menu_id
    INNER JOIN flavor f ON f.flavor_id = md.flavor_id
    INNER JOIN size s ON s.size_id = md.size_id
    WHERE o.order_id = p_order_id
    ORDER BY order_item_id, item_type;
    
    /*
    SELECT 
        'Package Details' as result_type,
        order_item_id,
        package_menu_detail_id,
        item_match,
        original_price,
        upgrade_cost,
        final_price
    FROM temp_results;*/
    
    DROP TEMPORARY TABLE IF EXISTS temp_default_package;
    DROP TEMPORARY TABLE IF EXISTS temp_ordered_package;
    DROP TEMPORARY TABLE IF EXISTS temp_results;
    
END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
/*!50003 SET collation_connection  = @saved_col_connection */ ;
/*!50003 DROP PROCEDURE IF EXISTS `p_retrieve_order_v2` */;
/*!50003 SET @saved_cs_client      = @@character_set_client */ ;
/*!50003 SET @saved_cs_results     = @@character_set_results */ ;
/*!50003 SET @saved_col_connection = @@collation_connection */ ;
/*!50003 SET character_set_client  = utf8mb4 */ ;
/*!50003 SET character_set_results = utf8mb4 */ ;
/*!50003 SET collation_connection  = utf8mb4_0900_ai_ci */ ;
/*!50003 SET @saved_sql_mode       = @@sql_mode */ ;
/*!50003 SET sql_mode              = 'ONLY_FULL_GROUP_BY,STRICT_TRANS_TABLES,NO_ZERO_IN_DATE,NO_ZERO_DATE,ERROR_FOR_DIVISION_BY_ZERO,NO_ENGINE_SUBSTITUTION' */ ;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `p_retrieve_order_v2`(
	IN p_order_id VARCHAR(255)
)
BEGIN
	DECLARE p_package_price DECIMAL(10,2);
    
    
    CALL p_menu_package_price_by_order(p_order_id,p_package_price);
    
	SELECT 
    o.order_id,
    m.menu_Name,
    f.flavor_name,
    s.size_name,
    oi.order_item_id,
   ROUND(md.price - (md.price * COALESCE(d.rate,0)),2) price,
    oi.quantity, 
    ROUND(md.price - (md.price * COALESCE(d.rate,0)),2) * oi.quantity as total_price,
    COALESCE(c.rate,0) coupon_rate,
    md.menu_detail_id
    FROM orders o
	INNER JOIN order_item oi ON o.order_id = oi.order_id
	INNER JOIN menu_order_regular mor ON mor.order_item_id = oi.order_item_id
	INNER JOIN menu_detail md ON md.menu_detail_id = mor.menu_detail_id
	INNER JOIN flavor f ON f.flavor_id = md.flavor_id
	INNER JOIN size s ON s.size_id = md.size_id
